import styled from "styled-components";

const Section = styled.section`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background-color: skyblue;
`;

const UL = styled.ul`
  list-style: none;
`;

const LI = styled.li`
  font-size: 1.5em;
`;

export { Section, LI, UL };
